import React from 'react';
import Navbar from './Navbar';


const About = () => {
    return (
        <>
            <Navbar />

            <div className='container' style={{
                backgroundColor: 'royalblue',
                marginBottom: '10px',
                padding:'26px'
            }}>
                <h1 align='center'> About Us</h1>
            </div>
        </>
    )
}
export default About;
